    public boolean lemonadeChange(int[] bills) {
        if(bills.length<=0){
            return true;
        }
        if(bills[0]!=5){
            return false;
        }
        int fiveB=0;
        int tenB=0;
        int twentyB=0;
        for (int bill : bills) {
            if(bill==5){
                fiveB++;
            }else if(bill==10){
                if(fiveB<1){
                    return false;
                }
                fiveB--;
                tenB++;
            }else if(bill==20){
                if(tenB>=1){
                    if(fiveB<1){
                        return false;
                    }
                    tenB--;
                    fiveB--;
                    twentyB++;
                }else {
                    if(fiveB<4){
                        return false;
                    }
                    fiveB-=3;
                    twentyB++;
                }
            }
        }
        return true;
    }
